link.script:
$(document).ready(function() {
$(".ctas").find("a").attr("id", "errorid");
$(".w60p").find("p").attr("id", "subText");

var tokenValue = "b0de1fc0082d7cbcad519bedc194cb6c";
var pageURLs = window.location.href;
var pageParentURLs = document.referrer;
var date = new Date();
date = date.toISOString();
var dateVal = date.replace("T", " ").split(".")[0];
var apiURL;

var environment = cdc.util.findEnvironment();

if (environment != "dev") {
environment = (!environment || environment == "prod" || environment == "unknown") ? "" : "-" + "stage";
} else {
environment = "-dev";
}


apiURL = "https://crs" + environment + ".cloudapps.cisco.com/support/cwsx/crs/service/csf/eprs?token=" + tokenValue + "&pageURL=" + pageURLs + "&pageParentURL=" + pageParentURLs + "&pageReportedDate=" + dateVal;
var url = apiURL;

$(".pri1").click(function() {

$.post(url, function(data, status) {

if (data === "SUCCESS") {

$(".pri-0").text("Thanks for your help!");
$("#errorid").html('Return to Cisco.com');
$("#subText").text("We've received your broken link report and we'll take care of it as soon as possible");

}
});
});
});
